  //         : 0
  //     }
  //     </p>
  //      <p>计划开始时间：${data.item.startTime ? data.item.startTime: ""}</p>
  //     <p>计划结束时间：${data.item.endTime ? data.item.endTime:""}</p>`
    const tooltipContent =`
      <p>资源名称：${data.item.LineName ? data.item.LineName : ""}</p>
      <p>完成进度：${
        data.item.HasQty >= 0 && data.item.PlanQty >= 0
          ? (data.item.HasQty / data.item.PlanQty) * 100
          : 0
      }%
      </p>
       <p>开始使用时间：${data.item.StartTime ? data.item.StartTime: ""}</p>
      <p>结束使用时间：${data.item.EndTime ? data.item.EndTime:""}</p>`
  
  
  element._tippy.setContent(tooltipContent);
}

function itemTippy(element, data) {
  setTippyContent(element, data);
  return {
    update(element, data) {
      if (element._tippy) element._tippy.destroy();
      setTippyContent(element, data);
    },
    destroy(element, data) {
      if (element._tippy) element._tippy.destroy();
    },
  };
}
