    timeFormat(date) {
      let y = date.getFullYear(); // 年
      let m = date.getMonth() + 1; // 月
      let d = date.getDate(); // 日
      // if (num === 1) {
      //   d = date.getDate();
      // }
      m = m < 10 ? "0" + m : m;
      d = d < 10 ? "0" + d : d;
      return y + "-" + m + "-" + d;
    },
